import React from 'react'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faHeart } from '@fortawesome/free-solid-svg-icons'


const likeSign = <FontAwesomeIcon icon={faHeart} />

const LikeBtn = () => {
  return (
    <div>
      {likeSign}
    </div>
  )
}

export default LikeBtn
